/*引入Vue*/
import Vue from 'vue'
/*引入App*/
import App from './App.vue'

/*引入ElementUI组件库*/
import ElementUI from 'element-ui';
/*引入ElementUI全部样式*/
import 'element-ui/lib/theme-chalk/index.css';

/*应用*/
Vue.use(ElementUI);
/*创建vm*/
new Vue({
	el:'#app',
	render: h => h(App),
})
